B.Pz=new A.dp(null,"<em>Ah, finished !<br>Your day is over and you have finally come home from school !</em>",t.j)
B.PA=new A.dp("Hint on a padlock","<em>So we're stuck in 1980 !? But how to get out of here ?<br>Here, there's another message in the chest...</em><br><br><strong>1! = 1 ; 2! = 2 ; 3! = 6 ; 4! = 24 ; 5! = <em>?</em></strong>",t.j)
B.PB=new A.dp(null,"<em>This draw has been locked with a key, and you don't have it.</em>",t.j)
B.PC=new A.dp("Hint on the password","<em>An hint is behind the pillow !</em><br><br>In a pond not far from here, I noticed that the number of water lilies doubles every night... At first there is 1, then 2 the next day, then 4 the day after, etc. so much so that the pond is covered with water lilies in just 7 days !<br><br><strong>The third and last digit of the computer password is the number of days it takes for the pond to be covered if at the beginning there are not 1, but 2 water lilies.</strong>",t.j)
B.PD=new A.dp("Locked bookshelf","<em>The bookshelf has been locked with a key, and you don't have it.</em>",t.j)
B.PE=new A.dp("Door locked","<em>Damn, the living room door is locked, and you don't have the key !</em>",t.j)
B.PF=new A.dp("Hint on the password","<em>You have unlocked this chest using the eight shaped key... And there is a message !</em><br><br>Rabbits and chickens are in the garden. We don't know how many there are, but we can count 20 paws and 6 heads.<br><br><strong>The second digit of the computer password is the rabbit count.</strong>",t.j)
B.PG=new A.dp("Hint on the username","<em>There's a message under the couch !</em><br><br>I always forget my username to login to my computer... But I know it's the name of my favorite school subject backwards !",t.j)
B.PH=new A.dp("Locked chest","<em>There seems to be a chest under this bed, but it has been locked with a key, and you don't have it...</em>",t.j)
B.PI=new A.dp("Things to do","An exam is scheduled for tomorrow, I should <strong>above all</strong> not forget to check my messages once I come back from school !!",t.j)
B.PJ=new A.dp("Hint on the password","<em>There is a message...</em><br><br>I don't usually write down my passwords on paper.... So I only noted hints, and on several papers hidden all over the house !<br>Here's the first hint<br><br>Aladdin and Aladde rub the lamp. The genie appears and asks them to make a wish. Aladdin asks <q>I want a penny... But it has to double every day for 30 days !</q>. Aladde retorts <q>Hehe, I want 1 million pounds now!</q><br><br><strong>The first digit of the computer password is pronounced in french like the last two letters of the richest person's name after 30 days.</strong>",t.j)
B.PK=new A.dp(null,"<em>Wow... I think we're back...<br>But what was that ??</em>",t.j)
B.PL=new A.dp("Hint on a padlock","<em>There seems to be a hint behind this lamp !</em><br><br>I was always forgetting the code of the chest padlock that is hidden in the flower pot in the living room... But now no more worries !<br>To unlock it, we just need to input the number of possible 3-digit code combinations !",t.j)
B.PM=new A.dp("Hint on the command",'<em>You have unlocked this bookshelf thanks to the clover shaped key... And there is a computer manual inside !</em><br><br>To restart a computer, use the following command. <p style="text-align: left; background-color: black; color: white; font-family: SourceCodePro; padding: 8px 4px;">reboot now</p>',t.j)
